import React, {Component} from 'react';
import './creecov.css';


class Creecov extends Component {
	render(){
		return(
			<div className="pa2 center bg-light-green br3 ma2 shadow-5 center fir_d">
				<form className="form_cree">
 					 <input type="radio" id="Simple" name="gender" value="Simple" c />
 					 <label for="Simple" className="mr5">Simple</label><br/>
  					 <input type="radio" id="Avancée" name="gender" value="Avancée" />
  					 <label for="Avancée">Avancée</label><br/>
				</form>
			</div>
			);
	}


}

export default Creecov;
